n></p><p><br></p><p><strong class="brz-cp-color7"> 10. Survival</strong></p><p><span class="brz-cp-color7">All terms of this Agreement, which by their nature are intended to survive termination of this Agreement, including without limitation, sections entitled “Warranty”, “Miscellaneous”, shall so survive termination.</span></p><p><br></p><p><strong class="brz-cp-color7"> 11. Force Majeure</strong></p><p><span class="brz-cp-color7">Any party shall be excused from performing hereunder to the extent that it is prevented from performing as a result of any act or event which occurs and is beyond its reasonable control, including, without limitation, acts of God, war, weather, utility or telecommunications outages, spread of communicable diseases, unrest or riot, strikes, any action of a governmental entity, executive orders; etc. provided that the party experiencing the force majeure provides the other with prompt written notice thereof and uses reasonable efforts to remedy effects of such matter.</span></p><p><br></p><p class="brz-ls-xs-im-3 brz-ls-sm-im-3 brz-ls-lg-0 brz-tp-paragraph brz-fs-lg-16 brz-fs-sm-im-17 brz-fs-xs-im-17 brz-lh-lg-1_5 brz-lh-sm-im-1_6 brz-lh-xs-im-1_6 brz-ff-montserrat brz-ft-google brz-fw-lg-400 brz-fw-sm-im-400 brz-fw-xs-im-400"><strong class="brz-cp-color7"> 12. Miscellaneous</strong></p><p class="brz-ls-xs-im-3 brz-ls-sm-im-3 brz-ls-lg-0 brz-tp-paragraph brz-fs-lg-16 brz-fs-sm-im-17 brz-fs-xs-im-17 brz-lh-lg-1_5 brz-lh-sm-im-1_6 brz-lh-xs-im-1_6 brz-ff-montserrat brz-ft-google brz-fw-lg-400 brz-fw-sm-im-400 brz-fw-xs-im-400"><span class="brz-cp-color7">If any provision of this Agreement is prohibited by law or held to be unenforceable, the remaining provisions hereof shall not be affected, and this Agreement shall continue in full force and effect as if such unenforceable provision had never constituted a part hereof, and the unenforceable provision shall be automatically amended to so as to best accomplish the objectives of such unenforcea